 then b:GiveAward(c,1)end end end)end})Awards.Add({sname="zsc_last_bite",name="Last Bite",desc="As a zombie, kill the last human and end the round.",tiers={1},func=function(c)hook.Add("LastBite","Awards.ZSC_LastBite",function(r,s)if r==s then return end;s:GiveAward(c,1)end)end})Awards.Add({sname="zsc_wake_up",name="Wake Up!",desc="As a zombie, kill a human that has fallen over from fall damage.",tiers={1},func=function(c)hook.Add("PostZombieKilledHuman","Awards.ZSC_WakeUp",function(b,s,t,u,v,w)if b.KnockedDown then s:GiveAward(c,1)end end)end})Awards.Add({sname="zsc_piano_trick",name="Piano Trick",desc="Kill a human or zombie with a heavy prop.",tiers={1}})Awards.Add({sname="zsc_hup_hdown",name="Heads Up, Humans Down",desc="Kill 4 humans by using props.",tiers={1},func=function(c)hook.Add("PostZombieKilledHuman","Awards.ZSC_HUpHDown",function(b,s,t,u,v,w)local x=t:GetClass()if x=="prop_physics"or x=="prop_physics_multiplayer"or x=="func_physbox"then s.m_HeadsUpHumansDownKills=s.m_HeadsUpHumansDownKills+1;if s.m_HeadsUpHumansDownKills>=4 then s:GiveAward(c,1)end end end)end})Awards.Add({sname="zsc_batter_up",name="Batter Up",desc="Kill 4 zombies by using props.",tiers={1},func=function(c)hook.Add("PostHumanKilledZombie","Awards.ZSC_BatterUp",function(b,s,t,u,y,z,v)local x=t:GetClass()if x=="prop_physics"or x=="prop_physics_multiplayer"or x=="func_physbox"then s.m_BatterUpKills=s.m_BatterUpKills+1;if s.m_BatterUpKills>=4 then s:GiveAward(c,1)end end end)end})Awards.Add({sname="zsc_breathe_this",name="Breathe This!",desc="As a zombie, kill the last human using nothing but the toxic gas damage from a Chem Zombie.",tiers={1},func=function(c)hook.Add("PostZombieKilledHuman","Awards.ZSC_BreatheThis",function(b,s,t,u,v,w)if not LASTHUMAN then return end;local x=t:GetClass()if x=="weapon_zs_chemzombie"and not u:IsExplosionDamage()then s:GiveAward(c,1)end end)end})Awards.Add({sname="zsc_close_call",name="Close Call",desc="Win a round with 3 or less health remaining.",tiers={1