_zs_magnum"or not u:IsBulletDamage()or not s.RicochetBullet then return end;s.m_OcelotKills=s.m_OcelotKills+1;if s.m_OcelotKills>=15 then s:GiveAward(c,1)end end)end})Awards.Add({sname="zsc_hellsing",name="Hellsing",desc="Kill 6 different zombies with one crossbow bolt.",tiers={1},func=function(c)hook.Add("PostHumanKilledZombie","Awards.ZSC_Hellsing",function(b,s,t,u,y,z,v)local x=t:GetClass()if x~="projectile_arrow"then return end;t.Kills=(t.Kills or 0)+1;if t.Kills>=6 then s:GiveAward(c,1)end end)end})Awards.Add({sname="zsc_grave_digger",name="Grave Digger",desc="Using a shovel, kill 10 zombies that are in the process of getting back up.",tiers={1},func=function(c)hook.Add("PostHumanKilledZombie","Awards.ZSC_GraveDigger",function(b,s,t,u,y,z,v)local x=t:GetClass()if x~="weapon_zs_shovel"then return end;if b.Revive and b.Revive:IsValid()then s.m_GraveDiggerKills=s.m_GraveDiggerKills+1;if s.m_GraveDiggerKills>=10 then s:GiveAward(c,1)end end end)end})Awards.Add({sname="zsc_sharpshooter",name="Sharpshooter",desc="Get 10 consecutive head shot kills with the Slug Rifle.",tiers={1},func=function(c)hook.Add("PostHumanKilledZombie","Awards.ZSC_Sharpshooter",function(b,s,t,u,y,z,v)local x=t:GetClass()if x~="weapon_zs_slugrifle"then return end;if v then s.m_SlugRifleHeadShots=s.m_SlugRifleHeadShots+1;if s.m_SlugRifleHeadShots>=10 then s:GiveAward(c,1)end else s.m_SlugRifleHeadShots=0 end end)end})Awards.Add({sname="zsc_nightmare_mode",name="Nightmare Mode",desc="Win a round with at least 500 points and 30 zombie kills (10 of those being melee) while using every return in loadout.",tiers={1},func=function(c)hook.Add("EndRound","Awards.ZSC_Nightmare",function(q)if q~=TEAM_HUMAN then return end;for k,b in ipairs(player.GetAll())do if b:Team()~=TEAM_HUMAN then continue end;if b.IsWeak and b.IsSlow and b.Clumsy and b.NoGhosting and b.m_Unlucky and b.m_Hemophilia and b.m_Palsy and b:Frags()>=500 and b.ZombiesKilled>=30 and b.m_MeleeKills>=10 then b:GiveAward(c,1)end end end)end})