AddCSLuaFile()SWEP.PrintName="Dread Brute"SWEP.Base="weapon_zs_poisonzombie"DEFINE_BASECLASS("weapon_zs_poisonzombie")SWEP.MeleeDamage=42;function SWEP:ApplyMeleeDamage(a,b,c)if SERVER then if a:IsPlayer()then local d=self:GetOwner()c=c+math.Clamp((GAMEMODE:GetWave()-4)*3,0,20)b.OldDamage=b.OldDamage+math.Clamp((GAMEMODE:GetWave()-4)*3,0,20)a:ApplyHumanDebuff("buff_zombie_dread",10,d)else c=c+math.Clamp((GAMEMODE:GetWave()-4)*4,0,20)b.OldDamage=b.OldDamage+math.Clamp((GAMEMODE:GetWave()-4)*4,0,20)end end;BaseClass.ApplyMeleeDamage(self,a,b,c)end;function SWEP:PlayAttackSound()self:EmitSound(string.format(")zombiesurvival/dreadknight/attack%d.ogg",math.random(5)),ZOMBIE_MOAN_ATTEN,math.random(60,65),self.MoanVolume,CHAN_USER_BASE)self:EmitSound(string.format(")zombiesurvival/dreadknight/attack%d.ogg",math.random(5)),ZOMBIE_MOAN_ATTEN,math.random(50,55),self.MoanVolume,CHAN_USER_BASE+1)end;function SWEP:PlayAlertSound()end;function SWEP:Reload()local d=self:GetOwner()if CurTime()<self:NextAlternateAbility()or IsValid(d.FeignDeath)or d.Revive or d:IsFrozen()then return end;self:DoAlert()end;function SWEP:PlayIdleSound()local d=self:GetOwner()local e=")npc/zombie/zombie_alert"..math.random(3)..".wav"for f=1,4 do timer.Simple(0.04*f,function()if d:IsValid()then d:EmitSound(e,ZOMBIE_MOAN_ATTEN,40+f*8,0.4*ZOMBIE_MOAN_VOLUME,CHAN_USER_BASE+f)end end)end end;if not CLIENT then return end;local g=Material("tools/toolsblack")function SWEP:PreDrawViewModel(h)render.ModelMaterialOverride(g)end;function SWEP:PostDrawViewModel(h,i,j)render.ModelMaterialOverride(nil)end;if CLIENT then function SWEP:AttackDisplaysInit()BaseClass.AttackDisplaysInit(self)self.AttackDisplays[#self.AttackDisplays+1]={Name="Dread Being",Description="Attacks inflict Dread.",Icon=Material("zombiesurvival/overlord-helm.png"),ClassSelectionOnly=true,Passive=true,KeyName=Style.Text("PASSIVE")}end end
