AddCSLuaFile()SWEP.PrintName="Dry Marrow"SWEP.Base="weapon_zs_zombie"SWEP.MeleeDamage=30;SWEP.OverrideSlow=0;SWEP.MeleeTaper=0.99;SWEP.MaxRespawns=5;AccessorFuncDT(SWEP,"Respawns","Int",0)function SWEP:Reload()self:SecondaryAttack()end;function SWEP:GetMeleeSpeedMul()return self:GetTimesRespawned()*0.05 end;function SWEP:GetTimesRespawned()return self.MaxRespawns-self:GetRespawns()end;function SWEP:Move(a,b)if a~=self:GetOwner()then return end;local c=b:GetMaxSpeed()+self:GetTimesRespawned()*15;b:SetMaxSpeed(c)b:SetMaxClientSpeed(c)return true end;function SWEP:PlayAlertSound()self:GetOwner():EmitSound("npc/fast_zombie/fz_scream1.wav",75,math.random(55,65),0.5)self:GetOwner():EmitSound("npc/fast_zombie/fz_scream1.wav",75,math.random(65,70),0.5)end;SWEP.PlayIdleSound=SWEP.PlayAlertSound;function SWEP:PlayAttackSound()self:GetOwner():EmitSound("npc/combine_soldier/die"..math.random(1,3)..".wav",75,math.random(55,60),0.5)self:GetOwner():EmitSound("npc/combine_soldier/die"..math.random(1,3)..".wav",75,math.random(65,70),0.5)end;if not CLIENT then return end;function SWEP:ViewModelDrawn()render.ModelMaterialOverride()render.SetColorModulation(1,1,1)end;local d=Material("Models/Barnacle/barnacle_sheet")function SWEP:PreDrawViewModel(e)render.ModelMaterialOverride(d)render.SetColorModulation(0.6,0.35,0.35)end;local f=input.LookupBinding("+attack")or"left mouse"local g=input.LookupBinding("+attack2")or"right mouse"local h=input.LookupBinding("+reload")or"reload"local i=input.LookupBinding("+speed")or"left shift"function SWEP:AttackDisplaysInit()self.AttackDisplays={{Name="Claws",KeyName=string.upper(f),NoEffects=true,ValFunc=function(j,k)return k:GetNextPrimaryFire()end,NoEffects=true,Icon=Material("zombiesurvival/second_wind.png")},{Name="Taunt",Description="Regenerate damage taken and resist Slow.",Description2="Cancel out of a swing, instantly readying the next attack.",KeyName=string.upper(g),ValFunc=function(j,k)return k:NextAlternateAbility()end,Icon=Material("zombies