--PATH gamemodes/zombiesurvival/entities/weapons/weapon_zs_f_dirtywater.lua:
AddCSLuaFile()SWEP.Base="weapon_zs_basefood"DEFINE_BASECLASS("weapon_zs_basefood")SWEP.PrintName="Dirty Water"SWEP.Description="Filthy water that should not be consumed. Secondary attack attempts to purify the dirty water with a heat source."if CLIENT then SWEP.Slot=GAMEMODE:GetWeaponSlot("WeaponSelectSlotFood")SWEP.SlotGroup=WEPSELECT_FOOD;SWEP.ViewModelFOV=80;SWEP.VElements={["base"]={type="Model",model="models/props/cs_office/water_bottle.mdl",bone="fooditem",rel="",pos=Vector(0.108,-0.553,-0.721),angle=Angle(-0.111,86.754,1.976),size=Vector(1.2,1.2,1.2),color=Color(255,200,200,255),surpresslightning=false,material="metal2",skin=0,bodygroup={}}}SWEP.WElements={["base"]={type="Model",model="models/props/cs_office/water_bottle.mdl",bone="ValveBiped.Bip01_R_Hand",rel="",pos=Vector(3.6180000305176,2.433000087738,-1.1310000419617),angle=Angle(0,0,-180),size=Vector(1.25,1.25,1.25),color=Color(255,200,200,255),surpresslightning=false,material="metal2",skin=0,bodygroup={}}}SWEP.ViewModelBoneMods={["ValveBiped.Bip01_R_Clavicle"]={scale=Vector(1,1,1),pos=Vector(3.234,-1.078,0),angle=Angle(0,0,0)},["ValveBiped.Bip01_L_Clavicle"]={scale=Vector(1,1,1),pos=Vector(0,0,0),angle=Angle(0,0,0)}}end;SWEP.FoodHealth=0;SWEP.FoodEatTime=FOOD_EATING_TIME_VERY_FAST;SWEP.EatAnim=ACT_VM_RECOIL2;SWEP.ViewModel="models/weapons/zs/c_cannedfood.mdl"SWEP.WorldModel="models/weapons/w_grenade.mdl"SWEP.FoodSpecialBenefit=true;SWEP.Primary.Ammo="fooddirtywater"SWEP.FoodIsLiquid=true;SWEP.EatViewAngles=Angle()SWEP.EatViewOffset=Vector()function SWEP:SecondaryAttack()self:SetNextSecondaryFire(CurTime()+0.5)local a=self:GetOwner()local b=a:GetAimVector()local c=a:GetShootPos()local d=util.TraceLine({start=c,endpos=c+b*80,filter=player.GetAll(),mask=MASK_SOLID})local e=false;for f,g in pairs(ents.FindByClass("env_fire"))do if g:IsValid()and g:GetPos():Distance(d.HitPos)<64 then e=true;break end end;if d.Entity and d.Entity:IsValid()and d.Entity.FireSource and d.Entity.CampFire and d.Entity:GetBurnTime()>CurTime()then e=true end;if not e then return end;a:EmitSound("ambient/levels/canals/toxic_slime_sizzle4.wav",45,math.random(85,90))if SERVER then if a:GetAmmoCount(self.Primary.Ammo)>0 then a:RemoveAmmo(1,self.Primary.Ammo)else a:StripWeapon("weapon_zs_f_dirtywater")end;if a:HasWeapon("weapon_zs_f_water")then local h=weapons.Get("weapon_zs_f_water")local i=h.Primary.Ammo;a:GiveAmmo(1,i,true)local j={killicon="weapon_zs_f_water"}a:CenterNotify(j," ",COLOR_GREEN,"Obtained 1 extra water.")else a:GiveWithoutSwitch("weapon_zs_f_water")end end end;function SWEP:SecretEffects(k,l)local a=self:GetOwner()if k==a then k:ApplyHumanDebuff("debuff_sickness",10*l)k:AddPoisonDamage(10*l)a:EmitSound("zombiesurvival/puke"..math.random(4)..".ogg",75,math.random(120,130))a:EmitSound("npc/barnacle/barnacle_digesting2.wav",75,110)local m=EffectData()m:SetOrigin(k:EyePos())m:SetNormal(k:GetForward())EffectTransmitFilter("explosion_fat",m,nil,a)if a:HasWeapon("weapon_zs_f_emptybottle")and a:GetModVal("alchemy_collection")>0 then local h=weapons.Get("weapon_zs_f_emptybottle")local i=h.Primary.Ammo;a:GiveAmmo(1,i,true)else a:GiveWithoutSwitch("weapon_zs_f_emptybottle")end end end
