AddCSLuaFile()SWEP.Base="weapon_zs_fastzombie"SWEP.PrintName="Slingshot Zombie"SWEP.MeleeDelay=0;SWEP.MeleeReach=42;SWEP.MeleeDamage=8;SWEP.MeleeForceScale=0.1;SWEP.MeleeSize=4.5;SWEP.MeleeDamageType=DMG_SLASH;SWEP.Primary.Delay=0.32;SWEP.SlowMeleeDelay=0.85;SWEP.SlowMeleeDamage=17;SWEP.PounceStartDelay=0.33;SWEP.PounceDelay=1.25;SWEP.PounceVelocity=910;SWEP.RoarTime=1.6;SWEP.Secondary.Automatic=false;SWEP.LegDamage=5;SWEP.NextAllowPounce=0;function SWEP:Move(a)if self:IsPouncing()or self:GetPounceTime()>0 then a:SetMaxSpeed(0)a:SetMaxClientSpeed(0)elseif self:GetClimbing()then a:SetMaxSpeed(0)a:SetMaxClientSpeed(0)local b=self:GetOwner()local c=self:GetClimbSurface()local d=b:SyncAngles()local e=c and c.Hit and(c.HitNormal.z<=-0.5 and d:Forward()*-1 or math.abs(c.HitNormal.z)<0.75 and c.HitNormal:Angle():Up())or Vector(0,0,1)local f=Vector(0,0,4)if b:KeyDown(IN_FORWARD)then b:SetGroundEntity(nil)f=f+e*250 end;if b:KeyDown(IN_BACK)then f=f+e*-250 end;if f.z==4 then if b:KeyDown(IN_MOVERIGHT)then f=f+d:Right()*100 end;if b:KeyDown(IN_MOVELEFT)then f=f+d:Right()*-100 end end;a:SetVelocity(f)return true elseif self:GetSwinging()then local g=a:GetMaxSpeed()*0.6666;a:SetMaxSpeed(g)a:SetMaxClientSpeed(g)elseif self:IsSlowSwinging()then local g=a:GetMaxSpeed()*0.85;a:SetMaxSpeed(g)a:SetMaxClientSpeed(g)end end;function SWEP:SecondaryAttack()if self:IsPouncing()or self:GetPounceTime()>0 then return end;self:EndSecondWind()if self:GetOwner():IsOnGround()or self:GetLastClimb()+0.25>=CurTime()then if CurTime()<self:GetNextPrimaryFire()or CurTime()<self:GetNextSecondaryFire()or CurTime()<self.NextAllowPounce then return end;self:SetNextPrimaryFire(math.huge)self:SetPounceTime(CurTime()+self.PounceStartDelay)self:GetOwner():ResetJumpPower()if SERVER then self:GetOwner():EmitSound(")npc/fast_zombie/leap1.wav",75,100,0.65,CHAN_VOICE)end elseif self:GetClimbSurface()then self:StartClimbing()end end;function SWEP:StartPounce()if self:IsPouncing()then return end;self:SetPounceTime(0)local b=self:GetOwner()if b:IsOnGround()or self:GetLastClimb()+0.25+self.PounceStartDelay>=CurTime()then self:SetPouncing(true)local h=b:GetPos()local i=b:EyeAngles()local j=b.DeathClass or b:GetZombieClass()local f=self.PounceVelocity;if SERVER then b:EmitSound(")npc/fast_zombie/fz_scream1.wav",75,100,0.65,CHAN_ITEM)local k=b:GetLastAttacker()local l=GAMEMODE.ZombieClasses["Slingshot Zombie Torso"]local m=math.min(b:Health()*1.25/b:GetMaxHealth(),1)local n=h;n.z=n.z+b:OBBMaxs().z;if l then b:RemoveStatus("overridemodel",false,true)b:SetZombieClass(l.Index)b:DoHulls(l.Index,TEAM_UNDEAD)b.DeathClass=j;n.z=n.z-b:OBBMaxs().z;local o=EffectData()o:SetEntity(b)o:SetOrigin(h)util.Effect("gib_player",o,true,true)timer.Simple(0,function()if b:IsValidLivingZombie()then b.DeathClass=nil;b.Revived=true;b:UnSpectateAndSpawn()b.Revived=nil;b.DeathClass=j;b:SetLastAttacker(k)b:SetPos(n)b:SetHealth(math.max(1,math.min(l.Health*m,l.Health)))b:SetEyeAngles(i)end end)end end;timer.Simple(0,function()if b:IsValidLivingZombie()then i.pitch=math.min(-10,i.pitch)b:SetGroundEntity(NULL)b:SetLocalVelocity((1-0.5*b:GetTotalLegDamage()/GAMEMODE.MaxLegDamage)*f*i:Forward())b:SetAnimation(PLAYER_JUMP)local p=b:GetActiveWeapon()if p:IsValid()and p.GetPouncing then p:SetPouncing(true)p:SetNextSecondaryFire(CurTime()+p.AlertDelay)end end end)else self:SetNextSecondaryFire(CurTime())self.ViewingAngles=nil;self.NextAllowJump=CurTime()self.NextAllowPounce=CurTime()+self.PounceDelay;self:SetNextPrimaryFire(CurTime()+0.1)self:GetOwner():ResetJumpPower()end end;if not CLIENT then return end;local q=Material("models/barnacle/barnacle_sheet")function SWEP:PreDrawViewModel(r)render.ModelMaterialOverride(q)render.SetColorModulation(0.64,0.37,0.39)end;function SWEP:ViewModelDrawn()render.ModelMaterialOverride()render.SetColorModulation(1,1,1)end;local s=input.LookupBinding("+attack")or"left mouse"local t=input.LookupBinding("+attack2")or"right mouse"local u=input.LookupBinding("+reload")or"reload"function SWEP:AttackDisplaysInit()self.AttackDisplays={{Name="Claws",KeyName=string.upper(s),ValFunc=function(v,p)return p:GetNextPrimaryFire()end,NoEffects=true,Icon=Material("zombiesurvival/second_wind.png")},{Name="Slingshot / Climb",Description="Leap forward, leaving legs behind and transforming into a torso.",Description2="Hitting a human inflicts Slow.",KeyName=string.upper(t),ValFunc=function(v,p)return p:GetNextSecondaryFire()end,Icon=Material("zombiesurvival/half-body-crawling.png")},{Name="Taunt",Description="Regenerate damage taken and resist Slow.",Description2="Cancel out of a swing, instantly readying the next attack.",KeyName=string.upper(u),ValFunc=function(v,p)return p:NextAlternateAbility()end,Icon=Material("zombiesurvival/flying-flag.png")}}end
