SWEP.Base="weapon_zs_boardpack"SWEP.PrintName="Fun Pack"SWEP.Description="It's simply a pack of wooden junk kept together with some duct tape.\nVery useful for making barricades when no materials are around.\nNeeds something like a hammer and nails to keep the things in place."SWEP.ViewModel="models/weapons/c_aegiskit.mdl"SWEP.WorldModel="models/props_debris/wood_board06a.mdl"SWEP.UseHands=true;SWEP.AmmoIfHas=true;SWEP.AllowEmpty=true;SWEP.Primary.ClipSize=3;SWEP.Primary.Automatic=true;SWEP.Primary.Ammo="junkboard"SWEP.Primary.Delay=1;SWEP.Primary.DefaultClip=4;SWEP.Secondary.ClipSize=1;SWEP.Secondary.DefaultClip=1;SWEP.Secondary.Ammo="dummy"SWEP.Secondary.Automatic=true;SWEP.Secondary.Delay=0.15;SWEP.WalkSpeed=SPEED_SLOW;SWEP.FullWalkSpeed=SPEED_SLOWEST;SWEP.JunkModels={Model("models/props_debris/wood_board04a.mdl"),Model("models/props_debris/wood_board06a.mdl"),Model("models/props_debris/wood_board02a.mdl"),Model("models/props_debris/wood_board01a.mdl"),Model("models/props_debris/wood_board07a.mdl"),Model("models/props_c17/furnituretable003a.mdl"),Model("models/props_wasteland/controlroom_filecabinet001a.mdl"),Model("models/props_c17/oildrum001.mdl"),Model("models/props_wasteland/kitchen_shelf001a.mdl"),Model("models/props/cs_militia/furniture_shelf01a.mdl"),Model("models/props_c17/door01_left.mdl")}SWEP.HoldType="physgun"function SWEP:SetReplicatedAmmo(a)self:SetDTInt(0,a)end;function SWEP:GetReplicatedAmmo()return self:GetDTInt(0)end;function SWEP:GetWalkSpeed()if self:GetPrimaryAmmoCount()>0 then return self.FullWalkSpeed end end;function SWEP:PrimaryAttack()if not self:CanPrimaryAttack()then return end;self:SetNextPrimaryAttack(CurTime()+self.Primary.Delay)self:EmitSound("weapons/iceaxe/iceaxe_swing1.wav",75,math.random(75,80))self:SendWeaponAnim(ACT_VM_PRIMARYATTACK)self.IdleAnimation=CurTime()+math.min(self.Primary.Delay,self:SequenceDuration())if SERVER then self:CreateProp()end end;function SWEP:SecondaryAttack()end;function SWEP:Reload()end;function SWEP:CanPrimaryAttack()if self:GetOwner():IsHolding()or self:GetOwner():GetBarricadeGhosting()then return false end;if math.abs(self:GetOwner():GetVelocity().z)>=256 then return false end;if self:GetPrimaryAmmoCount()<=0 then self:SetNextPrimaryFire(CurTime()+self.Primary.Delay)return false end;return true end;function SWEP:Think()if self.IdleAnimation and self.IdleAnimation<=CurTime()then self.IdleAnimation=nil;self:SendWeaponAnim(ACT_VM_IDLE)end;if SERVER then local a=self:GetPrimaryAmmoCount()if a~=self:GetReplicatedAmmo()then self:SetReplicatedAmmo(a)self:GetOwner():ResetSpeed()end end end
