AddCSLuaFile()SWEP.Base="weapon_zs_zombie"DEFINE_BASECLASS("weapon_zs_zombie")SWEP.PrintName="Gore Child"SWEP.ViewModel="models/weapons/c_arms_citizen.mdl"SWEP.WorldModel=""SWEP.UseHands=true;SWEP.ViewModelFOV=40;SWEP.MeleeDelay=0;SWEP.MeleeReach=16;SWEP.MeleeDamage=3;SWEP.MeleeForceScale=0.025;SWEP.OverrideSlow=0;SWEP.MeleeSize=1;SWEP.MeleeDamageType=DMG_SLASH;SWEP.Primary.Delay=0.32;function SWEP:Think()BaseClass.Think(self)if IsFirstTimePredicted()then local a=CurTime()local b=self:GetOwner()if self:GetSwinging()and not b:KeyDown(IN_ATTACK)and self.SwingStop and self.SwingStop<=a then self:SetSwinging(false)self.SwingStop=nil end end;self:NextThink(CurTime())return true end;function SWEP:Swung()if not IsFirstTimePredicted()then return end;self.SwingStop=CurTime()+0.5;if not self:GetSwinging()then self:SetSwinging(true)end;self.AltSwing=not self.AltSwing;local c=self:GetOwner():GetViewModel()c:SendViewModelMatchingSequence(c:LookupSequence(self.AltSwing and"fists_left"or"fists_right"))BaseClass.Swung(self)end;function SWEP:Deploy()local c=self:GetOwner():GetViewModel()c:SendViewModelMatchingSequence(c:LookupSequence("fists_draw"))return BaseClass.Deploy(self)end;function SWEP:Reload()self:SecondaryAttack()end;function SWEP:IsMoaning()return false end;function SWEP:PlayAlertSound()self:GetOwner():EmitSound("ambient/creatures/teddy.wav",65,85)end;function SWEP:PlayIdleSound()self:GetOwner():EmitSound("ambient/creatures/teddy.wav",65)end;function SWEP:PlayAttackSound()end;function SWEP:PlayHitSound()self:EmitSound("physics/body/body_medium_impact_hard"..math.random(6)..".wav",65,math.random(130,140),nil,CHAN_AUTO)end;function SWEP:PlayMissSound()self:EmitSound("npc/zombie/claw_miss"..math.random(2)..".wav",65,math.random(140,150),nil,CHAN_AUTO)end;function SWEP:SetSwinging(d)self:SetDTBool(2,d)end;function SWEP:GetSwinging()return self:GetDTBool(2)end
