elf:EmitSound(")weapons/zs_dds/zs_mini.ogg",75,math.random(110,120),1,CHAN_WEAPON+39)self:SendWeaponAnimation()self:TakeAmmo()self:TakeAmmo()self:DoConsumeBuildup()i:DoAttackEvent(true)if SERVER then local j=self:ShootProjectile(self.Primary.Damage*2,self:GetCone()/2.5,"projectile_juggernaut",1000,function(k)k:RotateAroundAxis(k:Up(),90)end)j.Gravity=0 end end else BaseClass.SecondaryAttack(self)end end;function SWEP:ShootBullets(l,m,n)BaseClass.ShootBullets(self,l,m,n)local i=self:GetOwner()if self:Clip1()<10 then local o=i:GetViewModel()self.NeedsReset=true;for p=1,10-self:Clip1()do local q=o:LookupBone("v_weapon.bullet"..p)o:ManipulateBoneScale(q,vector_tiny)end end;local r=self:Clip1()==0;if self.SpecialRecoil>0 then local s=r and 1 or 0;local t=math.Rand(0.8,1)*s;i:ViewPunch(Angle(t*-self.SpecialRecoil,t*(math.random(2)==1 and-1 or 1)*self.SpecialRecoil,(s-t)*(math.random(2)==1 and-1 or 1)*self.SpecialRecoil))end;if SERVER and r then for p=1,8 do local j=self:ShootProjectile(self.Primary.Damage*1.35,self:GetCone()/2.5,"projectile_juggernaut",1000,function(k)k:RotateAroundAxis(k:Up(),90)end)j.Gravity=0 end end end;function SWEP:Think()BaseClass.Think(self)if not self.NeedsReset then return end;if self:IsReloading()and self:GetReloadFraction()>0.4 then self:ResetChain()end end;function SWEP:ResetChain()local i=self:GetOwner()local o=i:GetViewModel()for p=1,10 do local q=o:LookupBone("v_weapon.bullet"..p)o:ManipulateBoneScale(q,Vector(1,1,1))end;self.NeedsReset=false end;function SWEP:EmitReloadSound()local u=util.SharedRandom("m249_special",0,1000)if u<=1 then self:SendWeaponAnim(ACT_VM_RELOAD_IDLE)end end
