adshots",NameFull="Renegade Stack",Requirement=100}SWEP.Animations={[ACT_VM_RELOAD]={BoneMods={{cycle=0,pose="none"},{cycle=0.75,pose="default"}}},[ACT_VM_RELOAD_END]={BoneMods={{cycle=0,pose="none"},{cycle=0.6,pose="default"}}},[ACT_VM_FIDGET]={BoneMods={{cycle=0.1,pose="inspect"},{cycle=0.8,pose="default"}}}}SWEP.UseHands=true;SWEP.Primary.Damage=14.2;SWEP.Primary.NumShots=6;SWEP.Primary.Delay=0.21;SWEP.Primary.ClipSize=12;SWEP.Primary.Ammo="buckshot"GAMEMODE:SetupDefaultClip(SWEP.Primary)SWEP.HeadshotMulti=1.3;SWEP.ConeMax=5.8;SWEP.ConeMin=5.2;SWEP.HasDeliberation=false;SWEP.Tier=5;SWEP.IronSightsPos=Vector(-4.04,-1,1.5)SWEP.IronSightsAng=Vector(-2,0,0)SWEP.UseLuaIronsightFireAnim=true;SWEP.OffsetReloadIronsYaw=-5;SWEP.OffsetReloadIronsZ=-2;SWEP.IsBanished=true;SWEP.Stability=WEAPON_STABILITY_STRONG;SWEP.ShardDamageMul=1;SWEP.MaxRenegadeStacks=3;GAMEMODE:AttachGenericModifiersArchetype("pistol_acc")function SWEP:EmitFireSound()self:EmitSound(")weapons/zs_meow/meowgauge_fire1.mp3",75,math.random(98,102),GUN_VOLUME)if CLIENT then local a=self:GetOwner()local b=a:GetStatus("buff_stack_renegade")if not b then return end;local c=b:GetStacks()local d=90+c*10+math.random(10)self:EmitSound(")weapons/zs_meow/meow.ogg",90,d,0.5,CHAN_STATIC)end end;if SERVER then function SWEP.BulletCallback(e,f,g,h)local i=f.Entity;local j=g:GetInflictor()if j.SpecialFire then return end;if i:IsValidLivingZombie()and e:IsHeadshot(f.HitGroup,i,g)then j:AddWeaponBuildup(2*j:PierceScaling(h))end;if j:CanConsumeBuildup()then j:DoConsumeBuildup()e:GiveStack("buff_stack_renegade",j.MaxRenegadeStacks)end end end;function SWEP:EmitReloadSound()if math.random(1000)==1 then self:EmitSound("vo/streetwar/sniper/ba_hearcat.wav")end end;function SWEP:AdditionalShootBulletsFunc(k)local a=self:GetOwner()local b=a:GetStatus("buff_stack_renegade")if not b then return end;local c=math.min(b:GetStacks(),self.MaxRenegadeStacks)local l=c;k.tracer="tracer_meow"k.damage=k.damage*self.ShardDamageMul;self.SpecialFire=true;if c>=3 then local m=team.GetPlayers(TEAM_UNDEAD)local n=a:GetShootPos()for o,p in ipairs(m)do local q=p:EyePos()if q:Distance(n)>1024 then continue end;if not WorldVisible(n,q)then continue end;k.num=1;local r=k.dir;local s=k.spread;k.dir=(n-q):GetNormalized()*-1;k.spread=0;a:FireBulletsInfo(k)k.dir=r;k.spread=s;l=l-1;if l==0 then break end end end;if l==0 then self.SpecialFire=false;return end;k.num=l;DO_BULLET_LAG_COMP=true;a:FireBulletsInfo(k)DO_BULLET_LAG_COMP=nil;self.SpecialFire=false end
