TRIGHT;SWEP.BlockAnim=ACT_VM_IIN;SWEP.UnblockAnim=ACT_VM_IOUT;SWEP.BashAnim=ACT_VM_SWINGHARD;SWEP.NoHitSoundFlesh=true;SWEP.AllowQualityWeapons=true;SWEP.BlockRotation=Angle()SWEP.BlockOffset=Vector()SWEP.DeploySpeedMulti=1;SWEP.Stability=WEAPON_STABILITY_WEAKEST;SWEP.BlockReduction=WEAPON_BLOCK_REDUCTION_NORMAL;SWEP.BackstabRatio=2;SWEP.StaminaUsage=0.0525;SWEP.Tier=6;SWEP.BackwardsBonus=0.25;SWEP.InnateEffects={trinket_acid_attach=1}GAMEMODE:AttachCustomWeaponModifier("InstantKillChance","Instant Kill Chance %",1,1,true)GAMEMODE:AttachWeaponModifier(WEAPON_MODIFIER_MELEE_RANGE,2,1)function SWEP:PlaySwingSound()self:EmitSound("weapons/knife/knife_slash"..math.random(2)..".wav")end;SWEP.ComboTimings={[ACT_VM_PULLBACK_HIGH]={timing={0.1,0.3,0.45},dmg_multi={1,1,1.25}}}SWEP.NextComboTiming=-1;SWEP.CurrentComboAnim=ACT_INVALID;SWEP.CurrentComboIndex=-1;SWEP.CurrentComboAnimDuration=0;SWEP.CurrentComboAnimStart=0;function SWEP:LoadComboSet(a,b)b=b or 1;self:SendWeaponAnim(a)self:SetVMSpeed(b)local c=self:GetOwner():GetViewModel()local d=c:SelectWeightedSequence(a)local e=c:SequenceDuration(d)/b;self:SetNextIdle(CurTime()+e)self:SetComboAnimDuration(e)self.CurrentComboAnim=a;self.CurrentComboIndex=1;self.CurrentComboAnimStart=CurTime()self.NextComboTiming=self.CurrentComboAnimStart+self:GetCurComboVar("timing")*e end;function SWEP:GetCurComboVar(f)local g=self.ComboTimings[self.CurrentComboAnim]local h=g[f]local i=h[self.CurrentComboIndex]return i end;function SWEP:AdvanceCombo()self.CurrentComboIndex=self.CurrentComboIndex+1;local j=self:GetCurComboVar("timing")if not j then self.NextComboTiming=-1 else self.NextComboTiming=self.CurrentComboAnimStart+j*self:GetComboAnimDuration()end end;function SWEP:ThinkExtend()if self.NextComboTiming==-1 then return end;if CurTime()<self.NextComboTiming then return end;local k=self:GetOwner()k:DoAttackEvent(true)local l=self:GetCurComboVar("dmg_multi")or 1;self:MeleeSwing(self.MeleeDamage*l,self.MeleeRange,self.MeleeSize,false,false,true)self:AdvanceCombo()end;function SWEP:Reload()if self:GetNextPrimaryAttack()>CurTime()then return end;if not self:CanPrimaryAttack()then return end;self:TriggerWeaponBuildup()end;function SWEP:PlayHitSound()self:EmitSound("weapons/knife/knife_hitwall1.wav",75,130)end;function SWEP:PlayHitFleshSound()self:EmitSound("weapons/knife/knife_hit"..math.random(4)..".wav")end;SWEP.InstantKillChance=1;local m={}function SWEP:PostOnMeleeHit(n,o,p)if not n:IsValidZombie()then return end;if IsFirstTimePredicted()then self:AddWeaponBuildup(15)end;if not n:Alive()then return end;if n:GetBossTier()>=BOSSTIER_BOSS then return end;local q=util.SharedRandom("the_razor",0,1)local r=self.InstantKillChance/100;if q>r then return end;self:EmitSound("weapons/knife/knife_stab.wav",75,90,0.7,CHAN_WEAPON+1)self:EmitSound(")weapons/grenade_launcher1.wav",50,60,1,CHAN_WEAPON+2)if not SERVER then return end;local k=self:GetOwner()n:TakeSpecialDamage(n:Health(),DMG_DIRECT,k,self,p.HitPos)if n:Alive()then return end;if not m[k]then m[k]=0 end;m[k]=m[k]+1;k:CenterNotify({font="ZSHUDFontSmall"},"Pufulet claims the soul of this undead! Souls claimed: "..m[k])end;function SWEP:OnWeaponBuildupUse()self:LoadComboSet(ACT_VM_PULLBACK_HIGH)self:SetNextPrimaryFire(CurTime()+self:SequenceDuration())end;if SERVER then function SWEP:InitializeHoldType()self.ActivityTranslate={}self.ActivityTranslate[ACT_HL2MP_IDLE]=ACT_HL2MP_IDLE_KNIFE;self.ActivityTranslate[ACT_HL2MP_WALK]=ACT_HL2MP_WALK_KNIFE;self.ActivityTranslate[ACT_HL2MP_RUN]=ACT_HL2MP_RUN_KNIFE;self.ActivityTranslate[ACT_HL2MP_IDLE_CROUCH]=ACT_HL2MP_IDLE_CROUCH_PHYSGUN;self.ActivityTranslate[ACT_HL2MP_WALK_CROUCH]=ACT_HL2MP_WALK_CROUCH_KNIFE;self.ActivityTranslate[ACT_HL2MP_GESTURE_RANGE_ATTACK]=ACT_HL2MP_GESTURE_RANGE_ATTACK_KNIFE;self.ActivityTranslate[ACT_HL2MP_GESTURE_RELOAD]=ACT_HL2MP_GESTURE_RELOAD_KNIFE;self.ActivityTranslate[ACT_HL2MP_JUMP]=ACT_HL2MP_JUMP_KNIFE;self.ActivityTranslate[ACT_RANGE_ATTACK1]=ACT_RANGE_ATTACK_KNIFE end end
