EAD,-0.15)function SWEP:Think()BaseClass.Think(self)local a=self:GetOwner()self.LastRecharge=self.LastRecharge or CurTime()if self.LastRecharge<CurTime()then local b=a:GetModVal("charge_rate")local c=self.RechargeRate/b;if CurTime()-self.LastRecharge>c then local d=math.floor((CurTime()-self.LastRecharge)/c)self.LastRecharge=CurTime()self:SetClip1(math.min(self.Primary.ClipSize,self:Clip1()+d))end end;local e=CurTime()local f=self:GetForceChargeFinish()if f~=0 and f<e then self:SetForceChargeFinish(0)local g=self:Clip1()+math.ceil(self.Primary.ClipSize*0.25)g=math.min(g,self.Primary.ClipSize)self:SetClip1(g)end end;function SWEP:Initialize()BaseClass.Initialize(self)self.LastRecharge=CurTime()self:SetClip1(0)end;function SWEP:Reload()end;function SWEP:FireAnimationEvent(h,i,j,k)if j==6001 then return true end;if j==21 or j==22 then return true end end;function SWEP:EmitFireSound()self:EmitSound(self.Primary.Sound,75,150)end;function SWEP:CanPrimaryAttack()if self:GetOwner():IsHolding()or self:GetOwner():GetBarricadeGhosting()then return false end;if self:Clip1()<self.RequiredClip then self:EmitSound("buttons/button9.wav",75,150)self:SetNextPrimaryFire(CurTime()+0.2)return false end;self.LastRecharge=CurTime()+self.RechargeDelay;return self:GetNextPrimaryFire()<=CurTime()end
