SWEP.PrintName="'Salvation' Sigil Cannon"SWEP.Description="A slow loading man portable recoilless rifle that summons and fires 11kg sigils at 255 m/s. Shortly after impact ".."with the undead the sigils teleport away, causing a massive but low damaging explosion. Etched on the side, you can".." read the following:\n 'Judge those who do injustice to me, fight with those who fight with me! Take hold of a weapon,".."a shield, and rise to help me! Draw for the sword, and sheath it in those who afflict me, say to my soul, I am thy salvation.'"SWEP.Base="weapon_zs_baseproj"DEFINE_BASECLASS("weapon_zs_baseproj")if CLIENT then SWEP.HUD3DPos=Vector(4,0,15)SWEP.HUD3DAng=Angle(0,180,180)SWEP.HUD3DScale=0.04;SWEP.HUD3DBone="base"SWEP.ViewModelFOV=60;SWEP.ViewModelFlip=false;SWEP.Slot=GAMEMODE:GetWeaponSlot("WeaponSelectSlotExplosives")SWEP.SlotGroup=WEPSELECT_EXPLOSIVE end;SWEP.HoldType="rpg"SWEP.ViewModel="models/weapons/c_rpg.mdl"SWEP.WorldModel="models/weapons/w_rocket_launcher.mdl"SWEP.UseHands=true;SWEP.SelfKnockback=250;SWEP.Tier=6;SWEP.Primary.Sound=Sound(")weapons/stinger_fire1.wav")SWEP.ReloadSound=Sound(")vehicles/tank_readyfire1.wav")SWEP.Primary.Delay=0.66;SWEP.Primary.Damage=366;SWEP.Primary.ClipSize=3;SWEP.Primary.Ammo="scrap"SWEP.Primary.DefaultClip=5;SWEP.Primary.Projectile="projectile_fakesigil"SWEP.Primary.ProjVelocity=13386;SWEP.Primary.ProjGravity=600;SWEP.KilliconColors=KILLICON_COLORS_CONTRA;SWEP.ReloadSpeed=0.6;SWEP.WalkSpeed=SPEED_SLOWEST;SWEP.ConeMax=0.5;SWEP.ConeMin=0.5;SWEP.Taper=0.5;SWEP.SkeletalResFalloffMul=math.huge;SWEP.AllowQualityWeapons=true;SWEP.PermitDismantle=true;SWEP.DismantleScrap=0;SWEP.Recoil=5;SWEP.IgnoreTransmitFilter=false;GAMEMODE:AttachWeaponModifier(WEAPON_MODIFIER_RELOAD_SPEED,0.05,2)function SWEP:CanReload()return self:GetNextReload()<=CurTime()and self:GetReloadFinish()==0 and(self:GetPrimaryClipSize()>0 and self:Clip1()<self:GetPrimaryClipSize()and self:Ammo1()>0)end;function SWEP:EmitFireSound()self:EmitSound(")weapons/physcannon/energy_disintegrate5.wav",80,100,0.25,CHAN_WEAPON)self:EmitSound(")weapons/stinger_fire1.wav",80,math.random(140,150),0.54,CHAN_USER_BASE+10)self:EmitSound(")weapons/zs_m82/m82_fire1.ogg",80,math.random(70,80),0.75,CHAN_USER_BASE+11)end;function SWEP:EmitReloadSound()self:EmitSound(")weapons/physcannon/physcannon_charge.wav",60,50,0.85,CHAN_ITEM)self:EmitSound(")items/battery_pickup.wav",60,57,GUN_VOLUME*0.85,CHAN_USER_BASE+20)end;function SWEP:EmitReloadFinishSound()self:EmitSound(")npc/scanner/scanner_scan1.wav",60,250,1,CHAN_ITEM)if CLIENT then self:NudgeViewmodel(Vector(0,0,0),Angle(0,2,-1),0.2,0.2)end end;function SWEP:CanPrimaryAttack()if not BaseClass.CanPrimaryAttack(self)then return end;local a=self:GetOwner()local b=a:MeleeTrace(52,2,nil,nil,false,override_team)if b and b.HitWorld then a:EmitSound(")player/suit_denydevice.wav",60,100,1,CHAN_WEAPON)self:SetNextPrimaryFire(CurTime()+self.Primary.Delay)if CLIENT then self:NudgeViewmodel(Vector(0,0,0),Angle(10,0,0),0.1,0.4)end;return false else a:DoSelfKnockBack(self.SelfKnockback)return true end end;function SWEP:PreProjectileModify(c)local a=self:GetOwner()if IsValid(a)then local d=a:EyeAngles()d:RotateAroundAxis(d:Right(),-90)c:SetAngles(d)end end;function SWEP:ProjectilePhysModify(c)c:SetAngleVelocity(Vector(0,0,10*360))c:SetMass(11)c:SetAngleDragCoefficient(0.025)c:SetDragCoefficient(0.025)c:SetMaterial("Concrete")c:SetDamping(100,1000)end;function SWEP:FinishReload()self:FinishReloadEffects()self:SetNextReload(0)self:SetReloadStart(0)self:SetReloadFinish(0)self:EmitReloadFinishSound()self.Deliberation=0;local a=self:GetOwner()if not a:IsValid()then return end;a:ResetStaminaRegen()local e=self:Clip1()local f=a:GetAmmoCount(self.Primary.Ammo)local g=math.min(f,self:GetPrimaryClipSize()-e)a:SetAmmo(f-g,self.Primary.Ammo)self:SetClip1(e+g)end
