se,nocull=false,material="models/zs/new_sigil/sigil_crystal",skin=0,bodygroup={}},["rock 3"]={type="Model",model="models/props_debris/concrete_chunk05g.mdl",bone="ValveBiped.Bip01_R_Hand",rel="Bottom",pos=Vector(0.945,-1.414,4.842),angle=Angle(-10.423,77.578,-125.311),size=Vector(0.2,0.2,0.2),color=Color(0,255,255,255),surpresslightning=false,bonemerge=false,highrender=false,nocull=false,material="models/zs/new_sigil/sigil_crystal",skin=0,bodygroup={}},["rock 4"]={type="Model",model="models/props_debris/concrete_chunk03a.mdl",bone="ValveBiped.Bip01_R_Hand",rel="Bottom",pos=Vector(-0.853,1.591,1.59),angle=Angle(-30.776,123.812,-143.86099),size=Vector(0.08,0.08,0.08),color=Color(0,255,255,255),surpresslightning=false,bonemerge=false,highrender=false,nocull=false,material="models/zs/new_sigil/sigil_crystal",skin=0,bodygroup={}},["rock 4+"]={type="Model",model="models/props_debris/concrete_chunk03a.mdl",bone="ValveBiped.Bip01_R_Hand",rel="Bottom",pos=Vector(0.049,1.705,3.94),angle=Angle(58.226,140.336,136.519),size=Vector(0.08,0.08,0.08),color=Color(0,255,255,255),surpresslightning=false,bonemerge=false,highrender=false,nocull=false,material="models/zs/new_sigil/sigil_crystal",skin=0,bodygroup={}}}function SWEP:PrimaryAttack(a)if not self:CanPrimaryAttack()then return end;self:SetNextPrimaryFire(CurTime()+self.Primary.Delay)if not self:GetOwner():GetStatus("buff_sigilblessing")then if SERVER then self:GetOwner():CenterNotify(COLOR_RED,"You do not have a Sigil Blessing.")end;return end;self:SendWeaponAnim(ACT_VM_THROW)if self.DelayedThrow then self.ScheduledThrow=CurTime()+self:SequenceDuration()*0.65;self.IsSecondaryThrow=a else self:Throw(a)end end
--PATH gamemodes/zombiesurvival/entities/weapons/weapon_zs_sigilfragment/shared.lua:
SWEP.PrintName="Sigil Fragment"SWEP.Description="A mysterious stone that holds some power over the world.\nReturns you to any uncorrupted Sanity Sigil that you're pointing towards.\nMust be near sigil to buy."SWEP.Base="weapon_zs_basemelee"SWEP.ViewModel="models/weapons/c_bugbait.mdl"SWEP.WorldModel="models/weapons/w_bugbait.mdl"SWEP.UseHands=true;SWEP.HoldType="slam"SWEP.WalkSpeed=SPEED_FAST;SWEP.AmmoIfHas=true;SWEP.Primary.ClipSize=1;SWEP.Primary.Automatic=true;SWEP.Primary.Ammo="sigilfragment"SWEP.Primary.Delay=1;SWEP.Primary.DefaultClip=1;SWEP.Secondary.ClipSize=1;SWEP.Secondary.DefaultClip=1;SWEP.Secondary.Automatic=false;SWEP.Secondary.Ammo="dummy"SWEP.BoxPhysicsMin=Vector(-4,-4,-4)SWEP.BoxPhysicsMax=Vector(4,4,4)SWEP.TeleportStatus="sigilteleport"SWEP.TeleportEffect="sigil_teleport"SWEP.TeleConsume=true;function SWEP:Initialize()self:SetWeaponHoldType(self.HoldType)GAMEMODE:DoChangeDeploySpeed(self)if CLIENT then self:SCKInit()end end;function SWEP:CanPrimaryAttack()if self:GetOwner():IsHolding()or self:GetOwner():GetBarricadeGhosting()or GAMEMODE:NumUncorruptedSigils()<=0 then return false end;if self:GetPrimaryAmmoCount()<=0 then self:SetNextPrimaryFire(CurTime()+self.Primary.Delay)return false end;return true end;function SWEP:PrimaryAttack()if not self:CanPrimaryAttack()then return end;self:SetNextPrimaryFire(CurTime()+3)local a=self:GetOwner()local b=a:GetViewModel()if IsValid(b)then b:SendViewModelMatchingSequence(b:LookupSequence("squeeze")or 0)end;a:DoAttackEvent()self:EmitSound("ambient/levels/labs/teleport_preblast_suckin1.wav",70,140)self.Teleport=CurTime()+3;self.NextDeploy=nil;self.NextIdle=nil;if SERVER then local c=a:GiveStatus(self.TeleportStatus)if c:IsValid()then c:SetFromSigil(self)c:SetEndTime(CurTime()+3.5*a:GetSigilTeleportMul(true))c.TPDuration=3.5 end end end;function SWEP:SecondaryAttack()end;function SWEP:CanSecondaryAttack()return false end;function SWEP:Reload()return false end;function SWEP:Deploy()GAMEMODE:WeaponDeployed(self:GetOwner(),self)if self:GetPrimaryAmmoCount()<=0 then self:SendWeaponAnim(ACT_VM_THROW)else self:SendWeaponAnim(ACT_VM_DEPLOY)end;self.NextIdle=CurTime()+2;return true end;function SWEP:Holster()self.NextDeploy=nil;self.NextIdle=nil;self.Teleport=nil;if CLIENT then self:SCKHolster()end;return true end;function SWEP:Think()if self.Teleport and CurTime()>=self.Teleport then self.Teleport=nil;self.NextIdle=CurTime()+1 elseif self.NextIdle and CurTime()>=self.NextIdle then self.NextIdle=nil;self:SendWeaponAnim(ACT_VM_IDLE)elseif self.NextDeploy and self.NextDeploy<=CurTime()then self.NextDeploy=nil;if 0<self:GetPrimaryAmmoCount()then self:SendWeaponAnim(ACT_VM_DRAW)else self:SendWeaponAnim(ACT_VM_THROW)if SERVER then self:Remove()end end end end
