SPELL.Name="Icicle Blast"SPELL.Damage=34;SPELL.Ranged=false;SPELL.Continuous=true;SPELL.Description="Rapidly fires small ice shards for a small amount of damage and cold slow. Small chance to inflict Frostbite."SPELL.ManaCost=2;SPELL.ID=2;SPELL.InitialDelay=1;SPELL.RefireDelay=0.15;SPELL.SpellColor=Color(137,207,240)SPELL.Velocity=1400;local a=Material("sprites/light_glow02_add")function SPELL:SpellEffect()if not util.SimpleEffectFilter(self:GetOwner())then return end;local b=self:GetPos()render.SetMaterial(a)render.DrawSprite(b,16,4,Color(0,229,255))self.NextEmit=self.NextEmit or 0;if RealTime()<self.NextEmit then return end;self.NextEmit=RealTime()+0.04;local c=ParticleEmitter(b)if not c then return end;if MySelf:IsValid()and MySelf:Team()==TEAM_HUMAN then c:SetNearClip(16,128)end;local d=c:Add("particle/sparkles",b)d:SetVelocity(self:GetVelocity():GetNormalized()*-1+VectorRand()*math.random(60,120))d:SetAirResistance(math.random(70,100))d:SetGravity(Vector(0,0,-10))d:SetDieTime(math.Rand(0.1,0.3))d:SetStartAlpha(200)d:SetEndAlpha(0)d:SetStartSize(0)d:SetEndSize(0.4)d:SetRoll(math.Rand(0,360))d:SetRollDelta(math.Rand(-6,6))d:SetColor(255,255,255)c:Finish()end;function SPELL:PreEntModify()local e=self:GetOwner()self:SetPos(self:GetPos()+e:GetRight()*math.Rand(3,6)+e:GetUp()*math.Rand(1,-6))end;function SPELL:OnContinuousAttack()if not IsFirstTimePredicted()then return end;self:EmitSound("weapons/zs_spellbook/book.ogg",75,150,0.7)end;function SPELL:OnAttack()if not IsFirstTimePredicted()then return end;self:EmitSound("<npc/manhack/mh_blade_snick1.wav",75,math.random(115,120),1)end;function SPELL:OnHit(f,b,g,h)local e=self:GetOwner()if not e:IsValidLivingHuman()then return end;local i=self:ProjectileDamageSource()if f and f:IsValidLivingZombie()then f:AddLegDamageExt(3.5,e,i,SLOWTYPE_COLD)if math.random(10)~=1 then return end;f:AddFrostbiteDamage(self.ProjDamage*0.75,e,i)end end
