wav",pitch=90},{time=1.3,snd=")weapons/foley/heavy3.ogg",pitch=90},{time=1.75,snd=")weapons/m4a1/m4a1_clipin.wav",pitch=90}},[ACT_VM_PULLPIN]={{time=0.1,snd=")weapons/foley/medium2.ogg"},{time=1.7,snd=")weapons/foley/light1.ogg"}}}SWEP.Poses={["rel"]={["ValveBiped.Bip01_L_Clavicle"]={scale=Vector(1,1,1),pos=Vector(4,0.5,0.5),angle=Angle(0,0,0)},["ValveBiped.Bip01_L_Finger0"]={scale=Vector(1,1,1),pos=Vector(),angle=Angle(-30,0,0)}},["relin"]={["ValveBiped.Bip01_L_Clavicle"]={scale=Vector(1,1,1),pos=Vector(0,0,-3),angle=Angle(0,0,0)},["ValveBiped.Bip01_L_Finger0"]={scale=Vector(1,1,1),pos=Vector(),angle=Angle(-30,0,0)}},["inspectfix"]={["ValveBiped.Bip01_L_Clavicle"]={scale=Vector(1,1,1),pos=Vector(0,1.5,2.5),angle=Angle(0,0,0)}},["inspectfix2"]={["ValveBiped.Bip01_L_Clavicle"]={scale=Vector(1,1,1),pos=Vector(0,2,1),angle=Angle(0,0,0)}}}SWEP.Animations={[ACT_VM_DEPLOY]={BoneMods={{cycle=0.05,pose="rel"},{cycle=0.4,pose="relin"},{cycle=0.7,pose="rel"},{cycle=0.87,pose="default"}}},[ACT_VM_PULLPIN]={BoneMods={{cycle=0,pose="inspectfix"},{cycle=0.5,pose="inspectfix2"},{cycle=0.9,pose="default"}}}}end;SWEP.PrintName="'Vindicator' Grenade Launcher"SWEP.Description="Rapidly fires highly explosive grenades with low taper. Unparalleled for clearing a horde. Can eventually launch a hindering cluster bomb for 3 ammo, dealing massive damage."SWEP.Base="weapon_zs_baseproj"DEFINE_BASECLASS("weapon_zs_baseproj")SWEP.HoldType="smg"SWEP.ViewModel="models/weapons/zs/c_m4a1_reanim.mdl"SWEP.WorldModel="models/weapons/w_smg_ump45.mdl"SWEP.UseHands=true;SWEP.CSMuzzleFlashes=false;SWEP.Primary.ClipSize=7;SWEP.Primary.Ammo="impactmine"SWEP.Primary.Delay=0.55;SWEP.Primary.DefaultClip=7;SWEP.Primary.Damage=90;SWEP.Primary.NumShots=1;SWEP.InspectAnim=ACT_VM_PULLPIN;SWEP.ReloadAnim=ACT_VM_DEPLOY;SWEP.DrawAnim=ACT_VM_DRAW_DEPLOYED;SWEP.ConeMax=3.5;SWEP.ConeMin=3;SWEP.WalkSpeed=SPEED_SLOWEST;SWEP.Tier=6;SWEP.Taper=0.85;SWEP.Radius=80;SWEP.FireAnimSpeed=0.8;SWEP.ReloadSpeed=0.875;SWEP.Primary.Projectile="projectile_grenade_ch"SWEP.Primary.ProjVelocity=1100;SWEP.WeaponBuildup={Colour={150,150,30,255},Name="Assists",NameFull="Cluster Bomb",Requirement=200}GAMEMODE:AttachGenericModifiersArchetype("explosive")local a=GAMEMODE:AddNewRemantleWep("weapon_zs_morningstar")a.CollectiveName="Morningstar"a.Killicon="weapon_zs_morningstar"function SWEP:OnAssist(b)local c=self:GetOwner()if c:IsValid()then self:AddWeaponBuildup(20)end end;function SWEP:SecondaryAttack()if not self:CanPrimaryAttack()or self:Clip1()<3 then return end;if self:CanConsumeBuildup()then local d=self:GetOwner()self:CalculateNextAttackTime(self:GetFireDelay()*2)self:EmitFireSound(true)self:SendWeaponAnimation()self:TakeAmmo(3)self:DoConsumeBuildup()d:DoAttackEvent(true)if SERVER then local e=self:ShootProjectile(self.Primary.Damage*0.5,0,"projectile_flakbomb",900)e.SubProjectile="projectile_grenade_ch"e.FlakVelocity=45;e.SubCallback=function(f)f.Vindicator=true end end end end;function SWEP:EmitFireSound()self:EmitSound(")weapons/grenade_launcher1.wav",70,math.random(85,90),0.6,CHAN_WEAPON)self:EmitSound(")weapons/zs_gren/grenade_launcher.ogg",90,100,0.6,CHAN_WEAPON+20)end
